
def Skew(text):
	"""	Calculate a list of the running talley of the difference between the counts 
 	of G (+) and C (-) in the genome, text""" 
	skew = 0
	AllSkew = []
	AllSkew.append(skew)

	for i in text:
		
		if i == 'C':
			skew -= 1
		elif i == 'G':
			skew += 1
		else:
			skew = skew

		AllSkew.append(skew)


	return AllSkew

